 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p>": "<p>\u0412\u0432\u0435\u0434\u0438\u0442\u0435 \u0442\u0435\u043a\u0441\u0442 \u0434\u043b\u044f \u0443\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u044f \u0442\u0438\u043f\u0430 \"\u0437\u0430\u043f\u043e\u043b\u043d\u0438 \u043f\u0440\u043e\u043f\u0443\u0441\u043a\u0438\" \u0432 \u043f\u0440\u0435\u0434\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u043e\u0435 \u0434\u043b\u044f \u044d\u0442\u043e\u0433\u043e \u0432\u0438\u0434\u0430 \u0443\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0439 \u043f\u043e\u043b\u0435,\n\u043a\u043e\u043f\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0442\u0435\u043a\u0441\u0442\u0430 \u0438\u0437 \u0434\u0440\u0443\u0433\u043e\u0433\u043e \u0440\u0435\u0441\u0443\u0440\u0441\u0430,  \u0438\u043b\u0438 \u043f\u0435\u0447\u0430\u0442\u0430\u044f \u0442\u0435\u043a\u0441\u0442 \u043f\u0440\u044f\u043c\u043e \u0432 \u043f\u043e\u043b\u0435.<\/p><p>\n\u0427\u0442\u043e\u0431\u044b \u0432\u044b\u0431\u0440\u0430\u0442\u044c \u0441\u043b\u043e\u0432\u043e, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u0441\u043a\u0440\u044b\u0442\u044c, \u0449\u0435\u043b\u043a\u043d\u0438\u0442\u0435 \u0434\u0432\u0430\u0436\u0434\u044b \u043f\u043e \u044d\u0442\u043e\u043c\u0443 \u0441\u043b\u043e\u0432\u0443,\n\u0430 \u0437\u0430\u0442\u0435\u043c \u043d\u0430\u0436\u043c\u0438\u0442\u0435 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443  \u0421\u043a\u0440\u044b\u0442\u044c\/\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u044c \u0441\u043b\u043e\u0432\u043e.<\/p>", 
