 "Save in:": "\u0421\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0432:", 
 "Sorry, wrong file format.": "\u0418\u0437\u0432\u0438\u043d\u0438\u0442\u0435, \u043d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0439 \u0444\u043e\u0440\u043c\u0430\u0442 \u0444\u0430\u0439\u043b\u0430.", 
