 " <p>If the applet you're adding was generated \nby one of the programs in this drop down, please select it, \nthen add the data\/applet file generated by your program. <\/p>\n<p>eg. For Geogebra applets, select geogebra, then add the .ggb file that \nyou created in Geogebra.<\/p>": "<p>\u0415\u0441\u043b\u0438 \u0434\u043e\u0431\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0439 \u0430\u043f\u043f\u043b\u0435\u0442 \u0431\u044b\u043b \u0441\u043e\u0437\u0434\u0430\u043d \n\u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430, \u0432\u044b\u0434\u0435\u043b\u0438\u0442\u0435 \u0435\u0433\u043e, \n\u0437\u0430\u0442\u0435\u043c \u0434\u043e\u0431\u0430\u0432\u044c\u0442\u0435 \u0434\u0430\u043d\u043d\u044b\u0435\/\u0430\u043f\u043f\u043b\u0435\u0442, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u044b\u0435 \u044d\u0442\u043e\u0439 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u043e\u0439<\/p>\n<p>\u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0434\u043b\u044f \u0430\u043f\u043f\u043b\u0435\u0442\u043e\u0432 Geogebra, \u0432\u044b\u0431\u0440\u0430\u0442\u044c geogebra, \u0437\u0430\u0442\u0435\u043c \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c\n\u0444\u0430\u0439\u043b .ggb, \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u044b\u0439  \u0432 Geogebra.<\/p>", 
 "Tigrinya ": "\u0422\u0438\u0433\u0440\u0438\u043d\u0441\u043a\u0438\u0439 ", 
